import React from 'react';

import TodoList from './components/TodoList';
import TodoContextProvider from './context/TodoContext';
import './App.css';

function App() {
  return (
    <div className="App">
      <TodoContextProvider>
        <TodoList />
      </TodoContextProvider>
    </div>
  );
}

export default App;
